import React from 'react';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import useScrollTrigger from '@material-ui/core/useScrollTrigger';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
// import Box from '@material-ui/core/Box';
// import Typography from '@material-ui/core/Typography';
// import Button from '@material-ui/core/Button';
// import IconButton from '@material-ui/core/IconButton';
// import MenuIcon from '@material-ui/icons/Menu';

import './Header.scss';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    position: 'absolute',
    width: '100%',
    marginTop: '25px',
    zIndex: 10,
  },
  appBar: {
    borderRadius: 5,
    boxShadow: '0 2px 20px rgb(0 0 0 / 10%)',
    transition: 'all ease 250ms',
  },
  appBarFull: {
    borderRadius: 0,
    backgroundColor: '#bac866',
    transition: 'all ease 250ms',
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  navbarBrand: {
    padding: 5,
  },
  navbarBrandLogo: {
    maxWidth: 120,
    display: 'block',
  },
}));

export default function Header() {
  const classes = useStyles();
  const trigger = useScrollTrigger({
    disableHysteresis: true,
    threshold: 100,
  });
  return (
    <div className={classes.root}>
      <Container maxWidth="lg">
        <AppBar
          color="default"
          elevation={0}
          className={clsx(classes.appBar, {
            [classes.appBarFull]: trigger,
          })}
          position={trigger ? 'fixed' : 'static'}>
          <Container disableGutters maxWidth="lg">
            <Toolbar>
              <a href="#home" className={classes.navbarBrand}>
                {trigger ? (
                  <img
                    className={classes.navbarBrandLogo}
                    src="assets/img/white_logo.png"
                    alt="Logo"
                  />
                ) : (
                  <img className={classes.navbarBrandLogo} src="assets/img/logo.png" alt="Logo" />
                )}
              </a>
              <div className="collapse navbar-collapse" id="main-navbar">
                <ul className="navbar-nav mr-auto w-100 align-items-center justify-content-end">
                  <li className="nav-item">
                    <a className="nav-link" href="#home">
                      Home
                    </a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#about">
                      Our Professionals
                    </a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#how-work">
                      How it Works
                    </a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#team">
                      Blog
                    </a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#testimonials">
                      Testimonials
                    </a>
                  </li>
                  <li className="nav-item">
                    <a href="#0" className="nav-link">
                      Sign up /Login
                    </a>
                    <a href="#0" className="nav-link">
                      My Account
                    </a>
                  </li>
                  <li className="nav-item">
                    <a href="#0" className="nav-link">
                      Contact Us
                    </a>
                  </li>
                </ul>
              </div>
            </Toolbar>
          </Container>
        </AppBar>
      </Container>
    </div>
  );
}
